
<!DOCTYPE html>
<html lang="fr">
<head>
  <meta charset="UTF-8" />
  <title>Module e-learning - Fonctionnalités & Activités</title>
  <style>
    :root {
      --primary: #2563eb;
      --primary-light: #dbeafe;
      --danger: #b91c1c;
      --success: #15803d;
      --bg: #f3f4f6;
      --card: #ffffff;
      --text-main: #111827;
      --text-muted: #6b7280;
    }

    * {
      box-sizing: border-box;
    }

    body {
      margin: 0;
      font-family: system-ui, -apple-system, BlinkMacSystemFont, "Segoe UI", sans-serif;
      background: radial-gradient(circle at top left, #e0f2fe 0, #f9fafb 45%, #e5e7eb 100%);
      color: var(--text-main);
      display: flex;
      justify-content: center;
      align-items: center;
      min-height: 100vh;
      padding: 20px;
    }

    .app {
      max-width: 960px;
      width: 100%;
      background: rgba(255, 255, 255, 0.92);
      box-shadow: 0 18px 40px rgba(15, 23, 42, 0.15);
      border-radius: 18px;
      padding: 24px 26px 28px;
      backdrop-filter: blur(8px);
    }

    header {
      display: flex;
      justify-content: space-between;
      align-items: center;
      margin-bottom: 18px;
      gap: 12px;
    }

    .title-block {
      display: flex;
      flex-direction: column;
      gap: 4px;
    }

    h1 {
      margin: 0;
      font-size: 1.4rem;
      display: flex;
      align-items: center;
      gap: 8px;
    }

    h1 span.badge {
      font-size: 0.75rem;
      padding: 2px 8px;
      border-radius: 999px;
      background: var(--primary-light);
      color: var(--primary);
      font-weight: 600;
    }

    header p {
      margin: 0;
      font-size: 0.9rem;
      color: var(--text-muted);
    }

    .progress-wrapper {
      min-width: 180px;
      text-align: right;
    }

    .progress-label {
      font-size: 0.8rem;
      color: var(--text-muted);
      margin-bottom: 4px;
    }

    .progress-bar {
      width: 100%;
      height: 6px;
      border-radius: 999px;
      background: #e5e7eb;
      overflow: hidden;
    }

    .progress-bar-fill {
      height: 100%;
      width: 0%;
      background: linear-gradient(90deg, #2563eb, #22c55e);
      transition: width 0.4s ease;
    }

    .card {
      background: var(--card);
      border-radius: 14px;
      padding: 18px 18px 20px;
      border: 1px solid #e5e7eb;
    }

    .module-header {
      display: flex;
      flex-wrap: wrap;
      align-items: center;
      justify-content: space-between;
      gap: 10px;
      margin-bottom: 14px;
    }

    .module-title {
      display: flex;
      flex-direction: column;
      gap: 2px;
    }

    .module-title h2 {
      margin: 0;
      font-size: 1.2rem;
      display: flex;
      align-items: center;
      gap: 6px;
    }

    .module-title h2 span.tag {
      font-size: 0.75rem;
      padding: 1px 7px 2px;
      border-radius: 999px;
      background: #eef2ff;
      color: #4f46e5;
    }

    .module-subtitle {
      margin: 0;
      font-size: 0.9rem;
      color: var(--text-muted);
    }

    .instruction {
      font-size: 0.92rem;
      background: #eff6ff;
      color: #1e40af;
      padding: 8px 10px;
      border-radius: 10px;
      border: 1px dashed #bfdbfe;
      margin-bottom: 12px;
      display: flex;
      align-items: flex-start;
      gap: 8px;
    }

    .instruction-emoji {
      font-size: 1.1rem;
      margin-top: 1px;
    }

    .activities-grid {
      display: grid;
      grid-template-columns: repeat(auto-fit, minmax(220px, 1fr));
      gap: 10px;
      margin-bottom: 14px;
    }

    .activity-card {
      position: relative;
      padding: 10px 10px 10px 14px;
      border-radius: 10px;
      border: 1px solid #e5e7eb;
      background: #f9fafb;
      cursor: pointer;
      font-size: 0.9rem;
      display: flex;
      align-items: flex-start;
      gap: 8px;
      transition: transform 0.12s ease, box-shadow 0.12s ease, border-color 0.12s ease, background 0.12s ease;
    }

    .activity-card:hover {
      transform: translateY(-1px);
      box-shadow: 0 8px 18px rgba(15, 23, 42, 0.08);
      border-color: #cbd5f5;
      background: #ffffff;
    }

    .activity-card .bullet {
      width: 7px;
      height: 7px;
      border-radius: 999px;
      background: #9ca3af;
      margin-top: 5px;
      flex-shrink: 0;
    }

    .activity-card.selected {
      border-color: var(--primary);
      background: #eff6ff;
      box-shadow: 0 8px 18px rgba(37, 99, 235, 0.18);
    }

    .activity-card.selected .bullet {
      background: var(--primary);
    }

    .activity-card .checkmark {
      position: absolute;
      right: 8px;
      top: 8px;
      width: 18px;
      height: 18px;
      border-radius: 999px;
      border: 1px solid #d1d5db;
      display: flex;
      align-items: center;
      justify-content: center;
      font-size: 0.8rem;
      background: #ffffff;
      color: var(--primary);
      opacity: 0;
      transform: scale(0.7);
      transition: all 0.12s ease;
    }

    .activity-card.selected .checkmark {
      opacity: 1;
      transform: scale(1);
      border-color: var(--primary);
      background: #eff6ff;
    }

    .feedback {
      min-height: 36px;
      font-size: 0.9rem;
      margin-bottom: 6px;
      display: flex;
      align-items: center;
      gap: 8px;
    }

    .feedback.hidden {
      visibility: hidden;
    }

    .feedback-icon {
      font-size: 1.1rem;
    }

    .feedback-message {
      padding: 6px 9px;
      border-radius: 999px;
      background: #f3f4f6;
      color: var(--text-muted);
      border: 1px solid transparent;
    }

    .feedback.success .feedback-message {
      background: #dcfce7;
      color: #166534;
      border-color: #bbf7d0;
    }

    .feedback.error .feedback-message {
      background: #fef2f2;
      color: #991b1b;
      border-color: #fecaca;
    }

    .actions {
      display: flex;
      justify-content: flex-end;
      gap: 8px;
      margin-top: 4px;
    }

    button {
      border: none;
      border-radius: 999px;
      padding: 8px 16px;
      font-size: 0.9rem;
      cursor: pointer;
      font-weight: 500;
      display: inline-flex;
      align-items: center;
      gap: 6px;
      transition: transform 0.1s ease, box-shadow 0.1s ease, background 0.1s ease, opacity 0.1s ease;
    }

    button:active {
      transform: translateY(1px);
      box-shadow: none;
    }

    .btn-primary {
      background: var(--primary);
      color: #ffffff;
      box-shadow: 0 10px 18px rgba(37, 99, 235, 0.3);
    }

    .btn-primary:hover {
      background: #1d4ed8;
    }

    .btn-secondary {
      background: #e5e7eb;
      color: #111827;
    }

    .btn-secondary:hover {
      background: #d1d5db;
    }

    .btn-primary[disabled],
    .btn-secondary[disabled] {
      opacity: 0.6;
      cursor: default;
      box-shadow: none;
      transform: none;
    }

    .btn-next {
      display: none;
    }

    .btn-next.visible {
      display: inline-flex;
    }

    .pill {
      padding: 2px 8px;
      border-radius: 999px;
      font-size: 0.75rem;
      background: #f3f4f6;
      color: #4b5563;
    }

    .summary {
      text-align: center;
      padding: 18px 8px 8px;
    }

    .summary h2 {
      margin-top: 0;
    }

    .summary p {
      color: var(--text-muted);
      font-size: 0.9rem;
      max-width: 520px;
      margin: 6px auto 14px;
    }

    .summary ul {
      list-style: none;
      padding: 0;
      margin: 0 auto 12px;
      max-width: 520px;
      text-align: left;
      font-size: 0.9rem;
      color: var(--text-muted);
    }

    .summary li {
      margin-bottom: 4px;
      display: flex;
      align-items: center;
      gap: 6px;
    }

    .summary li span.bullet {
      width: 6px;
      height: 6px;
      border-radius: 999px;
      background: #9ca3af;
    }

    @media (max-width: 640px) {
      .app {
        padding: 16px;
      }
      header {
        flex-direction: column;
        align-items: flex-start;
      }
      .progress-wrapper {
        width: 100%;
        text-align: left;
      }
    }
  </style>
</head>
<body>
<div class="app" id="app">
  <header>
    <div class="title-block">
      <h1>
        Associer <em>fonctionnalités</em> & <em>activités</em>
        <span class="badge">Exercice interactif</span>
      </h1>
      <p>Votre mission : pour chaque fonctionnalité digitale, sélectionner les activités pour lesquelles elle est vraiment pertinente.</p>
    </div>
    <div class="progress-wrapper">
      <div class="progress-label">
        Étape <span id="stepNumber">1</span>/<span id="stepTotal">7</span>
      </div>
      <div class="progress-bar">
        <div class="progress-bar-fill" id="progressFill"></div>
      </div>
    </div>
  </header>

      { text: "Associations sportives (infos adhérents)", correct: true },
      { text: "Agences immobilières (nouveaux biens)", correct: true },
      { text: "Métiers à communication sensible (médecins…)", correct: false },
      { text: "Activités sans base client (vente ponctuelle B2B…)", correct: false }
    ]
  },
  {
    name: "FICHIER CLIENT",
    label: "Fichier client / CRM simplifié",
    hint: "L’outil est très utile si vous revoyez vos clients plusieurs fois dans le temps.",
    activities: [
      { text: "Commerces (fidélisation)", correct: true },
      { text: "Salons de coiffure, esthétique", correct: true },
      { text: "Coachs, formateurs", correct: true },
      { text: "Garages (suivi entretien)", correct: true },
      { text: "Agences immobilières", correct: true },
      { text: "Activités sans récurrence client (traiteur événementiel…)", correct: false },
      { text: "Métiers réglementés (avocats, notaires…)", correct: false }
    ]
  }
];

let currentIndex = 0;

function updateProgress() {
  document.getElementById("stepTotal").textContent = modulesData.length;
  document.getElementById("stepNumber").textContent = currentIndex + 1;
  document.getElementById("progressFill").style.width =
    ((currentIndex) / modulesData.length) * 100 + "%";
}

function renderCurrentModule() {
  updateProgress();
  const module = modulesData[currentIndex];

  document.getElementById("mainContent").innerHTML = `
    <section class="card">
      <div class="module-header">
        <div class="module-title">
          <h2>${module.name} <span class="tag">Fonctionnalité ${currentIndex + 1}</span></h2>
          <p class="module-subtitle">${module.label}</p>
        </div>
        <div class="pill">Sélectionnez toutes les activités pertinentes.</div>
      </div>

      <div class="instruction">
        <div class="instruction-emoji">💡</div>
        <div>${module.hint}</div>
      </div>

      <div class="activities-grid">
        ${module.activities
          .map(
            (a, i) => `
          <button class="activity-card" data-index="${i}" data-correct="${a.correct}">
            <span class="bullet"></span>
            <span>${a.text}</span>
            <span class="checkmark">✔</span>
          </button>`
          )
          .join("")}
      </div>

      <div class="feedback hidden" id="feedback">
        <span class="feedback-icon" id="feedbackIcon">🙂</span>
        <div class="feedback-message" id="feedbackMessage">Sélectionnez les activités puis validez.</div>
      </div>

      <div class="actions">
        <button class="btn-secondary" id="btnReset">Réinitialiser</button>
        <button class="btn-primary" id="btnValidate">Valider mes choix</button>
        <button class="btn-primary btn-next" id="btnNext">Suivant</button>
      </div>
    </section>
  `;

  document.querySelectorAll(".activity-card").forEach((c) =>
    c.addEventListener("click", () => {
      c.classList.toggle("selected");
      hideFeedback();
    })
  );

  document.getElementById("btnReset").onclick = resetSelection;
  document.getElementById("btnValidate").onclick = validateSelection;
  document.getElementById("btnNext").onclick = goToNext;
}

function hideFeedback() {
  document.getElementById("feedback").classList.add("hidden");
}

function showFeedback(type, msg) {
  const fb = document.getElementById("feedback");
  const icon = document.getElementById("feedbackIcon");
  const msgBox = document.getElementById("feedbackMessage");

  fb.className = "feedback " + type;
  msgBox.textContent = msg;
  icon.textContent = type === "success" ? "🎉" : "🤔";
}

function resetSelection() {
  document.querySelectorAll(".activity-card").forEach((c) =>
    c.classList.remove("selected")
  );
  hideFeedback();
}

function validateSelection() {
  let ok = true;
  document.querySelectorAll(".activity-card").forEach((c) => {
    const must = c.dataset.correct === "true";
    const sel = c.classList.contains("selected");
    if (must !== sel) ok = false;
  });

  const nextBtn = document.getElementById("btnNext");

  if (ok) {
    showFeedback("success", "Bravo ! Cliquez sur « Suivant ».");
    nextBtn.classList.add("visible");
  } else {
    showFeedback("error", "Ce n’est pas tout à fait juste. Réessayez !");
    nextBtn.classList.remove("visible");
  }
}

function goToNext() {
  currentIndex++;
  if (currentIndex < modulesData.length) renderCurrentModule();
  else renderSummary();
}

function renderSummary() {
  document.getElementById("progressFill").style.width = "100%";
  document.getElementById("stepNumber").textContent = modulesData.length;
  document.getElementById("mainContent").innerHTML = `
    <section class="card summary">
      <h2>Félicitations 🎉</h2>
      <p>Vous avez terminé l’exercice !</p>
      <button class="btn-primary" id="btnRestart">Recommencer</button>
    </section>
  `;
  document.getElementById("btnRestart").onclick = () => {
    currentIndex = 0;
    renderCurrentModule();
  };
}

renderCurrentModule();

document.getElementById("startBtn").onclick = () => {
  document.getElementById("cover").style.display = "none";
  document.getElementById("moduleContent").style.display = "block";
};

</script>
</div></body>
</html>
